import React, { useEffect } from "react";
import {Link} from 'react-router-dom';
import {useDispatch, useSelector} from 'react-redux'

//import actions
import { getDog } from "../../actions/actions";

//imort components
import { Card } from "../card/card";

//import css
import './home.css'

export const Home = () => {

const dispatch = useDispatch();
const allDogs = useSelector ((state) => state.dogs);

useEffect (() => {
    dispatch(getDog());
}, [])

    return(
        <>
            <div className = 'div_nav_home'>
                <nav className = 'nav_home'>
                        <h1 className = 'title_nav_home'>Henry Dogs</h1>
                    <Link to = '/add'>
                        <p className = 'p_nav_home'>Agregar raza</p>
                    </Link>
                </nav>
            </div>
            <div className = 'search_home'>
                <input className = 'input_search_home' placeholder = 'Search...' type="text" />
                <button className = 'buton_search_home' type= 'submit'>Buscar</button>
            </div>
        </>
    )
}
